import { SettingsInputHdmiOutlined } from "@material-ui/icons";

export const SET_CATEGORY = 'SET_CATEGORY';
export const SET_PRODUCT = 'SET_PRODUCT';
export const NAVIGATE_TO_HOME_PAGE = 'NAVIGATE_HOME';

export const setCategory = selectedCategory => ({
  type: SET_CATEGORY,
  payload: selectedCategory
});

export const setProduct = selectedProductID => ({
  type: SET_PRODUCT,
  payload: selectedProductID
});

export const navigateHome = () => ({
  type: NAVIGATE_HOME,
  payload: SettingsInputHdmiOutlined
});
